        address crossChainNameService
    ) external onlyOwner {
        s_crossChainNameService = crossChainNameService;
    }

    function register(
        string memory _name,
        address _address
    ) external onlyCrossChainNameService {
        if (lookup[_name] != address(0)) revert AlreadyTaken();

        lookup[_name] = _address;
    }
}

